import React from 'react'
import PropTypes from 'prop-types'

const Message = props => {
    return (
        <h3>
            <span className="badge amber darken-2">Mua Hàng Thành Công !</span>
        </h3>
    )
}

Message.propTypes = {

}

export default Message
